    false,nt"url": null,nt"notes": "The Vegetation Map of the Carrizo Plain
    Ecological Reserve, San Luis Obispo County, California was created by the California
    Department of Fish and Game (DFG) Vegetation Classification and Mapping Program
    (VegCAMP). Data from 379 vegetation Rapid Assessment surveys that were conducted
    from 2005-2008 was analyzed using cluster analysis to produce a vegetation and mapping
    classification for the 39,597-acre study area. The area was delineated and attributed
    by vegetation type; total cover; conifer tree, hardwood tree and total tree, shrub
    or herb cover; impacts present; and a subjective assessment of site quality using
    2007 1-foot resolution base imagery. The classification and map follow the National
    Vegetation Classification Standard (NVCS) and Federal Geographic Data Committee
    (FGDC) standard and State of California Vegetation and Mapping Standards. The minimum
    mapping unit is one acre, with 0.5 acre for wetland or special types. After a draft
    map was completed, 59% of the vegetated polygons were verified in the field, and
    polygons not visited were corrected if necessary. The classification is defined
    to meet the specifications of the National and State standards for vegetation classification,
    but is related through a cross-walking table (https://nrmsecure.dfg.ca.gov/FileHandler.ashx?DocumentID=15233)
    to other standard classifications in use locally or statewide.",nt"license_title":
